// import { Box } from "@chakra-ui/core";

import { Box, Button, Container, Flex, Image, Text } from "@chakra-ui/react";

function Home(){

    return (
        <div>
            {/* <Flex alignItems='center' gap='2'> */}
            <Container marginLeft={2}>
                <Flex>
                <Box  boxSize='100px' height="50px" marginTop={-3}>
                <Image src='https://logos-world.net/wp-content/uploads/2022/04/Harvest-Logo.png' alt='Dan Abramov' />
                </Box>
                <Box>
                    <Flex >
                            <Text fontSize='1.3rem'>WhyHarvest?</Text>
                            <Text fontSize='1.3rem'>Features</Text>
                            <Text fontSize='1.3rem'>Customes</Text>
                            <Text fontSize='1.3rem'>Integrations</Text>
                            <Text fontSize='1.3rem'>Pricing</Text>
                    </Flex>
                </Box>
                </Flex>
           
            </Container>
            
            <Container>
            <Text fontSize='1.3rem'>Sign in</Text>
            </Container>
            <Box>
            <Button  marginLeft="20px" colorScheme='blue'>Try Harvest free</Button>
            </Box>
            {/* </Flex> */}
        </div>
    )
}

export default Home;
